import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import { Button } from 'semantic-ui-react'

export default class test1 extends Component {
    render() {
        return (
            <div>
                <Link to='/test'><Button>click to go to test</Button></Link>
            </div>
        )
    }
}
